(31, 54, ':crab-square.jpg', 'crab-square.jpg'),
(31, 55, 'Diminishing the Damage of Derelict Crab Pots', 'Diminishing the Damage of Derelict Crab Pots'),
(31, 56, 'Veda convened scientists, government regulators, professional, tribal &amp; recreational fishermen, and citizens to work together to commit to action that is helping save the fishery and all that depend on it.', 'Veda convened scientists, government regulators, professional, tribal &amp; recreational fishermen, and citizens to work together to commit to action that is helping save the fishery and all that depend on it.'),
(31, 57, 'Derelict Fishing Gear Program', 'Derelict Fishing Gear Program'),
(31, 58, 'Northwest Straits Marine Conservation Foundation', 'Northwest Straits Marine Conservation Foundation'),
(31, 59, '', ''),
(31, 60, 'More than 12,000 crab pots are lost and become derelict in Puget Sound each year, killing over 177,000 harvestable crabs and costing the crab fishery more than $700,000. These “ghost” pots continue to catch crabs, which die and become bait for more crabs, creating an endless destructive cycle. Veda Environmental worked with the internationally recognized Northwest Straits Marine Conservation Foundation (NWSF) and its “Derelict Fishing Gear” program to design an overall process to engage key scientists and stakeholders to identify the priority actions to reduce lost crab pots in Puget Sound.', 'More than 12,000 crab pots are lost and become derelict in Puget Sound each year, killing over 177,000 harvestable crabs and costing the crab fishery more than $700,000. These “ghost” pots continue to catch crabs, which die and become bait for more crabs, creating an endless destructive cycle. Veda Environmental worked with the internationally recognized Northwest Straits Marine Conservation Foundation (NWSF) and its “Derelict Fishing Gear” program to design an overall process to engage key scientists and stakeholders to identify the priority actions to reduce lost crab pots in Puget Sound.'),
(31, 61, 'After an exhaustive review of all relevant research, including legislative and educational initiatives, Veda worked with NWSF to design a process for engaging stakeholders to identify and agree to key strategies and actions to reduce derelict crab pots. Key to Veda’s design was ensuring that all the right stakeholders – those individuals and entities who could be impacted by any of the potential strategies - were either directly involved or represented in the process. Invited stakeholders included key scientists; government agencies including WA Dept. of Fish and Wildlife, WA Dept. of Natural Resources, local and tribal governments; fishing groups including tribal, commercial and recreational; as well as vessel pilots, whose large ships can inadvertently cut fishing and crab pot lines.', 'After an exhaustive review of all relevant research, including legislative and educational initiatives, Veda worked with NWSF to design a process for engaging stakeholders to identify and agree to key strategies and actions to reduce derelict crab pots. Key to Veda’s design was ensuring that all the right stakeholders – those individuals and entities who could be impacted by any of the potential strategies - were either directly involved or represented in the process. Invited stakeholders included key scientists; government agencies including WA Dept. of Fish and Wildlife, WA Dept. of Natural Resources, local and tribal governments; fishing groups including tribal, commercial and recreational; as well as vessel pilots, whose large ships can inadvertently cut fishing and crab pot lines.'),
(31, 62, 'Veda designed and facilitated two half-day work sessions in which stakeholders developed a shared understanding of possibilities and implications and identified what were the highest priority actions to meaningfully reduce derelict crab pots. With Veda’s guidance, the group also agreed to and made commitments implementing specific priority actions.', 'Veda designed and facilitated two half-day work sessions in which stakeholders developed a shared understanding of possibilities and implications and identified what were the highest priority actions to meaningfully reduce derelict crab pots. With Veda’s guidance, the group also agreed to and made commitments implementing specific priority actions.'),
(31, 63, 'Veda delivered a final report that documented the entire process for identifying and convening key stakeholders, including a summary of the actions needed to make progress on the issue. The report also included an overview of the prioritization process, and showcased a table highlighting the highest priority actions that the entire group agreed were the most important.', 'Veda delivered a final report that documented the entire process for identifying and convening key stakeholders, including a summary of the actions needed to make progress on the issue. The report also included an overview of the prioritization process, and showcased a table highlighting the highest priority actions that the entire group agreed were the most important.'),
(31, 64, 'As a result of the workshop, NWSF has:\r\n\r\n• Received funding from the National Fish and Wildlife Foundation (NFWF) to implement one of the highest priority actions identified at the workshop: conducting an educational campaign to manufacturers of crab pots to increase the use of escapement cord (allowing crabs to escape should the pot become derelict).\r\n• Launched a highly successful Facebook ad campaign that reached 309,000 viewers with videos about behaviors that could help crab pots from becoming lost.\r\n• Conducted removal actions of lost crab pots in high priority areas identified at workshop.', 'As a result of the workshop, NWSF has: • Received funding from the National Fish and Wildlife Foundation (NFWF) to implement one of the highest priority actions identified at the workshop: conducting an educational campaign to manufacturers of crab pots to increase the use of escapement cord (allowing crabs to escape should the pot become derelict). • Launched a highly successful Facebook ad campaign that reached 309,000 viewers with videos about behaviors that could help crab pots from becoming lost. • Conducted removal actions of lost crab pots in high priority areas identified at workshop.'),
(31, 65, 'The Northwest Straits Initiative', 'The Northwest Straits Initiative'),
(31, 67, 'Veda is proud to support the amazing work of the Northwest Straits Initiative and Northwest Straits Foundation. Together, these two entities promote unique, citizen-based marine conservation projects throughout north Puget Sound, brilliantly weaving together science, policy and fun. From removing derelict fishing gear that harms wildlife to educating communities about the state of the science on ocean acidification, NWSI and NWSF work from the ground up to protect the waters and the wildlife of our beloved Puget Sound. What’s not to love?', 'Veda is proud to support the amazing work of the Northwest Straits Initiative and Northwest Straits Foundation. Together, these two entities promote unique, citizen-based marine conservation projects throughout north Puget Sound, brilliantly weaving together science, policy and fun. From removing derelict fishing gear that harms wildlife to educating communities about the state of the science on ocean acidification, NWSI and NWSF work from the ground up to protect the waters and the wildlife of our beloved Puget Sound. What’s not to love?'),
(31, 68, 'Their final product exceeded our expectations and was a great investment for us.', 'Their final product exceeded our expectations and was a great investment for us.'),
(31, 69, '- Pete Granger, Program Leader Marine Advisory Services, University of Washington Sea Grant', '- Pete Granger, Program Leader Marine Advisory Services, University of Washington Sea Grant'),
